@lucian [τ, נ] SN41 do you know how long after a game the validators are scoring it? Because from the code it sends 20 predictions every minutes, and scores 25 predictions every minutes as well. So when a game is done it can take more than a day to fully score the game (because it generates 20 predictions per minutes for a day, and process only 25 per minutes after the game is done). On top of that, from the validator logs it looks like sometimes the validator is waiting 3-4 minutes to score a new batch, which means the list of predictions to score can grow faster than the list of prediction being scored, hence creating even mode delay.
Would it be possible to display in the validator logs the date of the event being scored to confirm this hypothesis?
Also, what's the reasoning behind the current method of scoring instead of just scoring all the predictions together once after the match is ended?

@sportstensor・41 - The subnet immunity period has been increased to 10,800 blocks, which is approximately 36 hours. This should give new miners plenty of time to get their predictions scored to allow for proper competition in the current mechanism.

Please keep in mind that because of the asynchronous nature of our subnet where predictions are not scored immediately, you may want to think carefully about when you register. 🧠 

Happy predicting! 📊
